import React, { Component } from "react";
import {Link} from "react-router-dom";
import "./accueil.css";
import Data from "./data.json"

function Article (props) {


    return (
        <Link to={Data[0].id}>
            <div id="article">
                <p id="article__title">{Data[0].title}</p>
            </div>
        </Link>
    )
}

export default class Accueil extends Component{

    render() {
        return (
        <div id="articles">
            <Article />
        </div>
        )
    }
}
